import React, { Component } from "react";
import { connect } from "react-redux";

import { getUserStats } from "../../../../redux/actions/KPI/UserStatsAction";

import Barr from "./Bar";

class UsersLastMonthBarChart extends Component {
  constructor(props) {
    super(props);

    this.state = {
      first: "",
      second: "",
      third: "",
      fourth: "",
      fifth: "",
      sixth: "",
      seventh: "",
      eighth: "",
      ninth: "",
      tenth: "",
      eleventh: ""
    };
  }

  async componentDidMount() {
    const temp = await this.props.getUserStats();
    console.log(this.props.userStats.signups);

    const signups = this.props.userStats.signups;

    console.log(signups[0]);

    this.setState({
      first: 2,
      second: signups[1],
      third: signups[2],
      fourth: signups[3],
      fifth: signups[4],
      sixth: signups[5],
      seventh: signups[6],
      eighth: signups[7],
      ninth: signups[8],
      tenth: signups[9],
      elleventh: signups[10]
    });
  }
  render() {
    const data = [
      {
        name: "1",
        value: this.state.first
      },
      {
        name: "3",
        value: this.state.second
      },
      {
        name: "6",
        value: this.state.third
      },
      {
        name: "9",
        value: this.state.fourth
      },
      {
        name: "12",
        value: this.state.sixth
      },
      {
        name: "17",
        value: this.state.seventh
      },
      {
        name: "21",
        value: this.state.eighth
      },
      {
        name: "25",
        value: this.state.ninth
      },
      {
        name: "30",
        value: this.state.tenth
      },
      {
        name: "30",
        value: this.state.eleventh
      }
    ];

    return (
      <div>
        <Barr title="Users Last Month" data={data} />
      </div>
    );
  }
}

const mapStateToProps = state => {
  return {
    userStats: state.KPI.userStats
  };
};

export default connect(mapStateToProps, { getUserStats })(
  UsersLastMonthBarChart
);
